import React from 'react';
import { Link } from 'react-router-dom';
import btn from '../assets/btn1.png';
import background from '../assets/bgr1.jpg';

export default function MenuIntro() {

  const h1_style = {
    fontSize: "2.5rem",
    fontWeight: "bold",
    textAlign: "center",
    margin: "0 auto",
    padding: "0 auto",
    position: "relative",
  }

  return (
    <div className="float top-0 bg-white overflow-hidden mb-auto z-0 items-center hei justify-center">
      <img className="relative" src={background} alt="Unknown"/>


      <Link to='/menu' >
        <img src={btn} alt="Unknown" ></img>
      </Link>

      <h1 style={h1_style}> <b>Our Food</b></h1>
    </div>
  )
}
